def is_prime(num):
    if num <= 1:
        return False
    for i in range(2, int(num**0.5) + 1):
        if num % i == 0:
            return False
    return True

primes = []
limit = 100

for num in range(2, limit + 1):
    if is_prime(num):
        primes.append(num)
        if len(primes) == 100:
            break

print("The first 100 prime numbers are:")
for prime in primes:
    print(prime, end=", ")
